import React from 'react';
import {  IonButton, IonCol, IonContent, IonHeader, IonImg, IonInfiniteScroll, IonItem, IonList, IonPage, IonRow, IonText, IonTitle, IonToolbar } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab1.css';
import { Icon } from 'ionicons/dist/types/components/icon/icon';

const Tab1: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Event Feed</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
          <IonInfiniteScroll>
            <IonList>
              <IonItem>
                <IonCol>Pic and Club Name</IonCol>
                <IonCol>Image</IonCol>
              </IonItem>
            </IonList>
          </IonInfiniteScroll>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 1</IonTitle>
          </IonToolbar>
        </IonHeader>
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
